import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '40px',
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  sliderContainer: {
    width: '100%',
    maxWidth: '100%',
    margin: '20px 0',
  },
  carouselContainer: {
    boxSizing: 'none',
  },
  carouselImage: {
    width: '100%',
    height: '100%',
    objectFit: 'cover',
  },
  missionSection: {
    marginTop: '100px',
    display: 'flex',
    justifyContent: 'space-around',
    flexWrap: 'wrap',
  },
  missionCard: {
    width: '30%',
    border: '1px solid #ddd',
    borderRadius: '8px',
    overflow: 'hidden',
    margin: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  missionImage: {
    width: '100%',
    height: '200px',
    objectFit: 'cover',
  },
  missionCardContent: {
    padding: '15px',
  },
  missionTitle: {
    fontSize: '1.2rem',
    fontWeight: 'bold',
    marginBottom: '50px',
  },
  missionDescription: {
    fontSize: '1rem',
    color: '#555',
  },
  eventsSection: {
    marginTop: '100px',
    display: 'flex',
    justifyContent: 'space-around',
    flexWrap: 'wrap',
  },
  eventCard: {
    width: '30%',
    border: '1px solid #ddd',
    borderRadius: '8px',
    overflow: 'hidden',
    margin: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  eventImage: {
    width: '100%',
    height: '200px',
    objectFit: 'cover',
  },
  eventCardContent: {
    padding: '15px',
  },
  eventTitle: {
    fontSize: '1.2rem',
    fontWeight: 'bold',
    marginBottom: '10px',
  },
  eventDescription: {
    fontSize: '1rem',
    color: '#555',
  },
  registerButton: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginTop: '10px',
  },
  clubSection: {
    display: 'flex',
    justifyContent: 'space-around',
    alignItems: 'center',
    marginTop: '100px',
  },
  clubCircle: {
    textAlign: 'center',
    margin: '10px',
  },
  clubImageContainer: {
    position: 'relative',
  },
  clubImage: {
    width: '150px',
    height: '150px',
    borderRadius: '50%',
    marginBottom: '10px',
  },
  joinButton: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    position: 'absolute',
    bottom: '-20px',
    left: '50%',
    transform: 'translateX(-50%)',
  },
  main: {
    flex: 1,
    padding: '20px',
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    padding: '30px',
    bottom: 0,
    width: 'auto',
  },
  statisticsSection: {
    marginTop: '100px',
    marginBottom: '100px',
    textAlign: 'center',
  },
  statisticsHeading: {
    fontSize: '2rem',
    marginBottom: '20px',
  },
  statisticsContent: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  statisticItem: {
    margin: '0 20px',
  },
  statisticValue: {
    fontSize: '3rem',
    fontWeight: 'bold',
  },
  statisticLabel: {
    fontSize: '1.2rem',
  },
  aboutUsSection: {
    backgroundColor: '#eee',
    padding: '50px 0',
    display: 'flex',
    alignItems: 'center',
  },
  aboutUsContent: {
    flex: '1',
    paddingRight: '50px',
  },
  aboutUsHeader: {
    fontSize: '2rem',
    marginBottom: '20px',
  },
  aboutUsParagraph: {
    fontSize: '1rem',
    color: '#555',
  },
  aboutUsImageContainer: {
    flex: '1',
  },
  aboutUsImage: {
    maxWidth: '100%',
    maxHeight: '100%',
    borderRadius: '8px',
  },
};

const AboutUs = () => (
  <section style={styles.aboutUsSection}>
    <div style={styles.aboutUsContent}>
      <h2 style={styles.aboutUsHeader}>About Us</h2>
      <p style={styles.aboutUsParagraph}>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer nec odio. Praesent libero. Sed cursus ante
        dapibus diam. Sed nisi. Nulla quis sem at nibh elementum imperdiet. Duis sagittis ipsum. Praesent mauris. Fusce
        nec tellus sed augue semper porta. Mauris massa. Vestibulum lacinia arcu eget nulla. Class aptent taciti sociosqu
        ad litora torquent per conubia nostra, per inceptos himenaeos. Curabitur sodales ligula in libero. Sed dignissim
        lacinia nunc.
      </p>
      {/* Add more content about your organization here */}
    </div>
    <div style={styles.aboutUsImageContainer}>
      <img
        src="https://via.placeholder.com/800x300"
        alt="About Us Team in Action"
        className="about-us-image"
        style={styles.aboutUsImage}
      />
    </div>
  </section>
);

const Header = () => (
  <header style={styles.header}>
    {/* Removed website name */}
  </header>
);

const NavBar = () => (
  <nav style={styles.nav}>
    <div style={styles.logo}>Logo</div>
    <ul style={styles.navUl}>
      <li style={styles.navLi}>Home</li>
      <li style={styles.navLi}>Our Missions</li>
      <li style={styles.navLi}>Our Events</li>
      <li style={styles.navLi}>Our Clubs</li>
      <li style={styles.navLi}>About Us</li>
    </ul>
    <div style={styles.loginButton}>Login</div>
  </nav>
);

const ImageSlider = () => (
  <div style={styles.sliderContainer}>
    <Carousel showThumbs={false} autoPlay infiniteLoop interval={2000} style={styles.carouselContainer}>
      <div>
        <img alt="Slide 1" src="https://via.placeholder.com/800x300" style={styles.carouselImage} />
      </div>
      <div>
        <img alt="Slide 2" src="https://via.placeholder.com/800x300" style={styles.carouselImage} />
      </div>
      <div>
        <img alt="Slide 3" src="https://via.placeholder.com/800x300" style={styles.carouselImage} />
      </div>
    </Carousel>
  </div>
);

const MissionCard = ({ title, description, imageUrl }) => (
  <div style={styles.missionCard}>
    <img alt={title} src={imageUrl} style={styles.missionImage} />
    <div style={styles.missionCardContent}>
      <h3 style={styles.missionTitle}>{title}</h3>
      <p style={styles.missionDescription}>{description}</p>
    </div>
  </div>
);

const MissionSection = () => (
  <div style={styles.missionSection}>
    <MissionCard title="Mission 1" description="Description 1" imageUrl="https://via.placeholder.com/300" />
    <MissionCard title="Mission 2" description="Description 2" imageUrl="https://via.placeholder.com/300" />
    <MissionCard title="Mission 3" description="Description 3" imageUrl="https://via.placeholder.com/300" />
  </div>
);

const EventCard = ({ title, description, imageUrl }) => (
  <div style={styles.eventCard}>
    <img alt={title} src={imageUrl} style={styles.eventImage} />
    <div style={styles.eventCardContent}>
      <h3 style={styles.eventTitle}>{title}</h3>
      <p style={styles.eventDescription}>{description}</p>
      <div style={styles.registerButton}>Register</div>
    </div>
  </div>
);

const EventsSection = () => (
  <div style={styles.eventsSection}>
    <EventCard title="Event 1" description="Description 1" imageUrl="https://via.placeholder.com/300" />
    <EventCard title="Event 2" description="Description 2" imageUrl="https://via.placeholder.com/300" />
    <EventCard title="Event 3" description="Description 3" imageUrl="https://via.placeholder.com/300" />
  </div>
);

const ClubCircle = ({ imageUrl }) => (
  <div style={styles.clubCircle}>
    <div style={styles.clubImageContainer}>
      <img alt="Club" src={imageUrl} style={styles.clubImage} />
      <div style={styles.joinButton}>Join</div>
    </div>
  </div>
);

const ClubsSection = () => (
  <div style={styles.clubSection}>
    <ClubCircle imageUrl="https://via.placeholder.com/150" />
    <ClubCircle imageUrl="https://via.placeholder.com/150" />
    <ClubCircle imageUrl="https://via.placeholder.com/150" />
  </div>
);

const StatisticsSection = () => (
  <div style={styles.statisticsSection}>
    <h1 style={styles.statisticsHeading}>Statistics</h1>
    <div style={styles.statisticsContent}>
      <div style={styles.statisticItem}>
        <div style={styles.statisticValue}>1000</div>
        <div style={styles.statisticLabel}>Members</div>
      </div>
      <div style={styles.statisticItem}>
        <div style={styles.statisticValue}>50</div>
        <div style={styles.statisticLabel}>Clubs</div>
      </div>
      <div style={styles.statisticItem}>
        <div style={styles.statisticValue}>20</div>
        <div style={styles.statisticLabel}>Events</div>
      </div>
    </div>
  </div>
);

const Footer = () => (
  <footer style={{ ...styles.footer, display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: '30px' }}>
    <div style={{ marginRight: 'auto', textAlign: 'left' }}>
      <h2 style={{ marginBottom: '5px' }}>Contact Us</h2>
      <ul style={{ listStyle: 'none', padding: 0 }}>
        <li>• Company Name: ABC Corporation</li>
        <li>• Email: info@abccorp.com</li>
        <li>• Phone: (555) 123-4567</li>
        <li>• Address: 123 Main Street, Cityville, State, 12345</li>
      </ul>
    </div>
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginRight: 'auto', textAlign: 'left'}}>

      <h2 style={{ marginBottom: '10px' }}>Menu</h2>
      <ul style={{ listStyle: 'none', padding: 0 }}>
        <li>• Home</li>
        <li>• About Us</li>
        <li>• Partners</li>
        <li>• Clubs</li>
        <li>• Contact Us</li>
      </ul>
    </div>
    <div style={{ textAlign: 'right' ,display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
      <div style={{ width: '50px', height: '50px', borderRadius: '50%', backgroundColor: '#ccc', marginBottom: '10px' }}></div>
      <p>Follow us on</p>
      <div style={{ display: 'flex' }}>
        <div style={{ width: '20px', height: '20px', borderRadius: '50%', backgroundColor: '#ccc', marginRight: '5px' }}></div>
        <div style={{ width: '20px', height: '20px', borderRadius: '50%', backgroundColor: '#ccc', marginRight: '5px' }}></div>
        <div style={{ width: '20px', height: '20px', borderRadius: '50%', backgroundColor: '#ccc', marginRight: '5px' }}></div>
      </div>
    </div>
  </footer>
);

const Home = () => (
  <div style={styles.app}>
    <Header />
    <NavBar />
    <ImageSlider />
    <MissionSection />
    <EventsSection />
    <ClubsSection />
    <StatisticsSection />
    <AboutUs />
    <Footer />
  </div>
);

export default Home;
